import React from "react";
import "../App.css";
import ListToDo from "../components/ListToDo";
import ShowList from "../components/ShowList";
import Footer from "../components/Footer";

const LandingPage = () => {
  return (
    <div className="App">
      .
      <ListToDo />
      <ShowList />
      <Footer />
    </div>
  );
};

export default LandingPage;
